import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
<div className="navbar">
  <NavLink
  to="/"
  exact={true}
  >
    Home
  </NavLink>

  <NavLink
  to="/register"
  exact={true}
  >
    Register
  </NavLink>

  <NavLink
  to="/login"
  exact={true}
  >
    Login
  </NavLink>

  <NavLink
  to="/logout"
  exact={true}
  >
    Logout
  </NavLink>

</div>

  );
};

export default NavBar;
